(1605, '_transient_redux-extensions-fetch', 'a:15:{s:11:"google-maps";a:7:{s:2:"id";i:4714;s:5:"title";s:11:"Google Maps";s:7:"created";s:19:"2016-02-10 03:02:51";s:7:"updated";s:19:"2016-02-11 06:45:34";s:7:"excerpt";s:0:"";s:3:"url";s:49:"https://reduxframework.com/extension/google-maps/";s:5:"thumb";s:75:"http://reduxframework.com/wp-content/uploads/edd/2016/02/google_map_ext.png";}s:10:"ad-remover";a:7:{s:2:"id";i:4526;s:5:"title";s:10:"Ad Remover";s:7:"created";s:19:"2016-01-12 04:02:58";s:7:"updated";s:19:"2016-01-12 04:04:22";s:7:"excerpt";s:0:"";s:3:"url";s:48:"https://reduxframework.com/extension/ad-remover/";s:5:"thumb";s:74:"http://reduxframework.com/wp-content/uploads/edd/2016/01/ext_ad_remove.png";}s:9:"accordion";a:7:{s:2:"id";i:2598;s:5:"title";s:9:"Accordion";s:7:"created";s:19:"2015-03-26 21:43:11";s:7:"updated";s:19:"2015-05-12 20:13:43";s:7:"excerpt";s:129:"The Redux Accordion extension is an improved way to group like items in your options panel, inside a collapsible accordion field.";s:3:"url";s:47:"https://reduxframework.com/extension/accordion/";s:5:"thumb";s:75:"http://reduxframework.com/wp-content/uploads/edd/2015/03/accordion_logo.png";}s:8:"repeater";a:7:{s:2:"id";i:2147;s:5:"title";s:8:"Repeater";s:7:"created";s:19:"2015-01-14 00:29:40";s:7:"updated";s:19:"2015-06-13 03:54:41";s:7:"excerpt";s:140:"Give your users the power of infinite flexibility with dynamic, repeatable fields. Use any Redux field and customize your user\'s experience.";s:3:"url";s:46:"https://reduxframework.com/extension/repeater/";s:5:"thumb";s:69:"http://reduxframework.com/wp-content/uploads/edd/2015/01/repeater.png";}s:15:"social-profiles";a:7:{s:2:"id";i:2049;s:5:"title";s:15:"Social Profiles";s:7:"created";s:19:"2014-12-16 05:40:43";s:7:"updated";s:19:"2015-08-21 16:13:28";s:7:"excerpt";s:153:"Give your users the ability to add social profiles (icons with links to their social pages) from one central field in your Redux Framework options panel.";s:3:"url";s:53:"https://reduxframework.com/extension/social-profiles/";s:5:"thumb";s:71:"http://reduxframework.com/wp-content/uploads/edd/2014/12/social_ext.png";}s:9:"js-button";a:7:{s:2:"id";i:1965;s:5:"title";s:9:"JS Button";s:7:"created";s:19:"2014-11-27 03:57:50";s:7:"updated";s:19:"2015-03-26 02:45:38";s:7:"excerpt";s:131:"Give your users the ability to run JavaScript functions manually from within the Redux Framework options panel via button clicks.  ";s:3:"url";s:47:"https://reduxframework.com/extension/js-button/";s:5:"thumb";s:70:"http://reduxframework.com/wp-content/uploads/edd/2014/11/js_button.png";}s:11:"multi-media";a:7:{s:2:"id";i:1963;s:5:"title";s:11:"Multi Media";s:7:"created";s:19:"2014-11-27 03:58:57";s:7:"updated";s:19:"2015-06-13 04:02:12";s:7:"excerpt";s:100:"Give your users the ability to upload and/or select multiple files from the Wordpress Media library.";s:3:"url";s:49:"https://reduxframework.com/extension/multi-media/";s:5:"thumb";s:72:"http://reduxframework.com/wp-content/uploads/edd/2014/11/multi-media.png";}s:10:"css-layout";a:7:{s:2:"id";i:1684;s:5:"title";s:10:"CSS Layout";s:7:"created";s:19:"2014-08-17 02:52:29";s:7:"updated";s:19:"2015-03-26 02:45:35";s:7:"excerpt";s:183:"The Redux CSS Layout extension is great and innovative new way to set the margin, border, border radius, and padding elements for any CSS selector, all from one easy to use interface.";s:3:"url";s:48:"https://reduxframework.com/extension/css-layout/";s:5:"thumb";s:71:"http://reduxframework.com/wp-content/uploads/edd/2014/08/css-layout.png";}s:13:"color-schemes";a:7:{s:2:"id";i:988;s:5:"title";s:13:"Color Schemes";s:7:"created";s:19:"2014-05-05 20:01:51";s:7:"updated";s:19:"2015-06-13 04:03:02";s:7:"excerpt";s:156:"Give your users the ability to change the color layout of their themes with virtually no effort. Allow your users to save, and re-use any number of presets.";s:3:"url";s:51:"https://reduxframework.com/extension/color-schemes/";s:5:"thumb";s:74:"http://reduxframework.com/wp-content/uploads/edd/2014/07/color_schemes.png";}s:11:"live-search";a:7:{s:2:"id";i:526;s:5:"title";s:11:"Live Search";s:7:"created";s:19:"2014-02-21 05:13:10";s:7:"updated";s:19:"2015-03-26 02:46:04";s:7:"excerpt";s:203:"Does your panel have so many options it\'s difficult for your users to locate things? Live Search will create a search box that will dynamically filter all your available options. No configuration needed!";s:3:"url";s:49:"https://reduxframework.com/extension/live-search/";s:5:"thumb";s:72:"http://reduxframework.com/wp-content/uploads/edd/2014/07/live-search.png";}s:9:"date-time";a:7:{s:2:"id";i:458;s:5:"title";s:18:"Date / Time Picker";s:7:"created";s:19:"2014-02-14 02:08:36";s:7:"updated";s:19:"2016-09-20 01:12:26";s:7:"excerpt";s:192:"The Redux Date-Time Picker (DTP) extension is a new way to select dates and times for use in text fields.  The DTP contains several modes based on how you\'d like to display time and date data.";s:3:"url";s:47:"https://reduxframework.com/extension/date-time/";s:5:"thumb";s:69:"http://reduxframework.com/wp-content/uploads/edd/2014/05/datetime.png";}s:9:"metaboxes";a:7:{s:2:"id";i:191;s:5:"title";s:9:"Metaboxes";s:7:"created";s:19:"2014-01-28 00:49:31";s:7:"updated";s:19:"2016-09-18 02:33:22";s:7:"excerpt";s:124:"Integrate your options panel and meta items into one. It even overrides your global variable, so you only have to code once.";s:3:"url";s:47:"https://reduxframework.com/extension/metaboxes/";s:5:"thumb";s:74:"http://reduxframework.com/wp-content/uploads/edd/2014/07/ext-metaboxes.png";}s:12:"widget-areas";a:7:{s:2:"id";i:208;s:5:"title";s:12:"Widget Areas";s:7:"created";s:19:"2014-01-28 05:49:30";s:7:"updated";s:19:"2016-04-25 13:24:37";s:7:"excerpt";s:253:"Why limit your users to a limited number of widget areas? With this extension your users will be able to create and delete as many widget areas as they desire. You need only allow supply them with a way to switch the widget area for any given page/post.";s:3:"url";s:50:"https://reduxframework.com/extension/widget-areas/";s:5:"thumb";s:77:"http://reduxframework.com/wp-content/uploads/edd/2014/07/ext-widget-areas.png";}s:10:"shortcodes";a:7:{s:2:"id";i:209;s:5:"title";s:10:"Shortcodes";s:7:"created";s:19:"2014-01-28 05:50:24";s:7:"updated";s:19:"2015-03-26 02:52:01";s:7:"excerpt";s:166:"Give your users some very simple, but powerful shortcodes. This extension makes a number of the WordPress core and functions and blog settings accessible to the user.";s:3:"url";s:48:"https://reduxframework.com/extension/shortcodes/";s:5:"thumb";s:75:"http://reduxframework.com/wp-content/uploads/edd/2014/07/ext-shortcodes.png";}s:11:"icon-select";a:7:{s:2:"id";i:328;s:5:"title";s:11:"Icon Select";s:7:"created";s:19:"2014-02-01 16:39:13";s:7:"updated";s:19:"2016-09-17 20:06:27";s:7:"excerpt";s:222:"Let your users select an icon of their choice from your choosing. You can incorporate any font family. You need only denote the prefix and supply the URL or path to the font CSS file. It will even enqueue the font for you.";s:3:"url";s:49:"https://reduxframework.com/extension/icon-select/";s:5:"thumb";s:72:"http://reduxframework.com/wp-content/uploads/edd/2014/07/icon_select.png";}}', 'no'),
