(1, 1, '2016-10-16 08:46:16', '2016-10-16 08:46:16', 'Üdvözlet! Ez az első saját WordPress-bejegyzés. Módosítható, vagy törölhető, aztán megkezdhető a honlap tartalommal történő feltöltése!', 'Helló Világ!', '', 'publish', 'open', 'open', '', 'hello-vilag', '', '', '2016-10-16 08:46:16', '2016-10-16 08:46:16', '', 0, 'http://localhost:8888/izmuvek-beta/?p=1', 0, 'post', '', 1),
(2, 1, '2016-10-16 08:46:16', '2016-10-16 08:46:16', 'Ez egy mintaoldal, egy WordPress-alapú honlap egy oldalának létrehozásához. Az oldal különbözik a bejegyzéstől, mert az oldal állandóan látszik a honlap menüjében, a navigáció során (a legtöbb sablonban). Az emberek többsége használja a Névjegy oldalt, amely arra szolgál, hogy a lehetséges látogatói számára elmondjanak magukról, vállalkozásukról, a honlapról néhány jellemző mondatot. Egyik lehetséges megoldás erre pl.:\n\n<blockquote>Helló Emberek!Ezt a fordítást a WordPress Magyarország Fordítói csapata végezte. Sok száz munkaórát fektettünk abba, hogy ezt a remek tartalomkezelő rendszert anyanyelvünkön, magyarul használhassa mindenki.</blockquote>\n\n.... vagy egy másik példa:\n<blockquote>A<strong> WordPress Magyarország</strong> tulajdonképpen a kezdetektől létezik anélkül, hogy kihirdette volna létét. <strong>A WordPress Magyarország egy Közösség!</strong> - a nyílt forráskódú, zseniális WordPress tartalomkezelő rendszer alkalmazására, megismerésére, tanulására szövetkeztünk.</blockquote>\n\nÚj WordPress-felhasználóként a <a href="http://localhost:8888/izmuvek-beta/wp-admin/">Vezérlőpult</a>ba lépve ez az oldal törölhető, módosítható, és új oldalak hozhatóak létre saját tartalommal. Jó szórakozást kíván a WordPress Nemzeközi Közössége!', 'Ez egy minta oldal', '', 'publish', 'closed', 'open', '', 'ez-egy-minta-oldal', '', '', '2016-10-16 08:46:16', '2016-10-16 08:46:16', '', 0, 'http://localhost:8888/izmuvek-beta/?page_id=2', 0, 'page', '', 0),
