(113, 1, '2016-10-31 16:37:30', '2016-10-31 14:37:30', 'A barátaim Trebinek hívnak, és Nekik már hosszú évek óta főzök rendszeresen. Sok hálás, bátorító és pozitív visszajelzést kaptam. Szerintem azért, mert a remek ízek, egészséges ételek elkészítése mellett soha nem okozott gondot az egyéni igények kielégítése. Mindenki ízigénye eltérő, sokan pedig egyedi alapanyagokat igényelnek. Nekem ez nem teher, hanem öröm, ha megrendelőim elégedett arcát látom.\r\n\r\nEzért szeretnék a heti változatos menüimben alkalmazkodni egyedi igényeitekhez! Így például adott menün belül ki tudom szűrni, és behelyettesíteni a számodra nem kívánt allergéneket és intoleranciákat.\r\n\r\nCukor, glutén vagy laktózmentesen szeretnél táplálkozni? Nem probléma…!\r\n\r\nCukor helyett steviát, kókuszvirágcukrot használok. Napraforgó olaj helyett egészséges zsiradékokat: kókuszzsír, olivaolaj, lenmagolaj, liba és kacsazsír, ami teljes értékű aminósavakat tartalmaz.\r\n\r\nHagyományos gabona és gluténtartalmú élelmiszerek helyett tökmag lisztet, lenmag lisztet, zab lisztet és kukorica lisztet használok. Preferált gabonák: jázminrizs, vörös-fekete-barna rizs, köles és hajdina…\r\n\r\nA sokszor nem kedvelt tejtermékek helyett kókusz és mandula tejjel főzök, sajtok közül pedig a vegán és laktózmentes termékeket részesítem előnyben.\r\n\r\nÉteleim tartósítószer mentesek, kizárom a vöröshagymát, ecetet és a feketeborsot.\r\n\r\nSertéshúsok közül csak házi füstölt termékekkel dolgozom: kolbásszal és szalonnával ízesítés céljából.\r\n\r\nÉteleimet megrendelheted paleo, hagyományos vagy egyéni elkészítési módban.\r\n\r\nNem bánunk szűkmarkúan az adagokkal, és hatékonyan csomagolva szállítjuk ki!\r\n\r\nPróbáld ki…nem fogsz csalódni!', 'Ízpolitika', '', 'publish', 'closed', 'closed', '', 'izpolitika', '', '', '2016-10-31 16:46:05', '2016-10-31 14:46:05', '', 0, 'http://localhost:8888/izmuvek-beta/?page_id=113', 0, 'page', '', 0),
